import React, { useEffect, useState } from 'react';
import Navbar from '../components/Navbar';
import Footer from '../components/Footer';
import Card from '../components/Card';
import Crousel from '../components/Crousel';

export default function Home() {
  const [foodCat, setFoodCat] = useState([]);
  const [foodItem, setFoodItem] = useState([]);

  const loadData = async () => {
    try {
      let response = await fetch('http://localhost:5000/api/foodData', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json'
        }
      });

      if (!response.ok) {
        throw new Error(`HTTP error! Status: ${response.status}`);
      }

      response = await response.json();
      setFoodItem(response[0]);
      setFoodCat(response[1]);
    } catch (error) {
      console.error('Error fetching data:', error);
      // Handle the error, show a message to the user, or retry the request.
    }
  };

  useEffect(() => {
    loadData();
  }, []);

  return (
    <div>
      <div>
        <Navbar />
      </div>
      <div>
        <Crousel />
      </div>
      <div className='m-3'>
        <div className='container'>
          {foodCat.length !== 0 ? (
            foodCat.map((data) => {
              return <div key={data._id}>{/* Render your category content here */}</div>;
            })
          ) : (
            <div>No categories available</div>
          )}

          {foodItem.length !== 0 ? (
            foodItem.map((item) => {
              return <div key={item._id}>{/* Render your food item content here */}</div>;
            })
          ) : (
            <div>No food items available</div>
          )}

          <Card />
        </div>
      </div>
      <div>
        <Footer />
      </div>
    </div>
  );
}
